const nodemailer = require("nodemailer");

const SMTP_CONFIG = require("./config/smtp");

const transporter = nodemailer.createTransport({
  host: SMTP_CONFIG.host,
  port: SMTP_CONFIG.port,
  secure: false,
  auth: {
    user: SMTP_CONFIG.user,
    pass: SMTP_CONFIG.pass,
  },
  tls: {
    rejectUnauthorized: false,
  },
});

async function email(data) {
  const { name, email } = data;
  const mailSent = await transporter.sendMail({
    html: `<body>
        <div style="text-align: center;">
            <img src="data:image/png;base64," height="500px" alt="Imagem com texto de incentivo para novos apoiadores"/>
            <h1>Como colaborar?</h1>
            1. Escolha o valor que gostaria de contribuir;<br />
            2. Envie um pix para o email educa.sptech@gmail.com;<br />
            3. Pronto! Voc j se tornou um apoiador da E-duca e nos ajuda a continuar mudando a vida de milhares de estudantes por todo o Brasil.<br />
        </div>
        </body>`,
    subject: "Torne-se um apoiador!",
    from: "E-duca Tech <educa.sptech@gmail.com",
    to: `${email}`,
  });

  console.log(mailSent);
}
module.exports = {
  email,
};
